import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import {
    selectSpeed,
    setSpeed,
} from './speedSlice'
import {
    selectGrid,
    updateGridAndNeighbors,
    initializeGridAndNeighbors
 } from './gridSlice'
import {
    selectStart
} from './gameStateSlice'

export default function Frequency() {
    const frq = useSelector(selectSpeed)
    const start = useSelector(selectStart)
    let disabled = ""
    if (!start) {
        disabled = "disabled"
    }
    const dispatch = useDispatch()
    return (
        <div>
            <input type="range" min="50" max="2000"
            id="speed" name="speed" value={frq} disabled
            onChange={e => dispatch(setSpeed(e.target.value))}></input>
            <label for="speed">Update Speed: {(frq/1000).toFixed(2)} s</label>
        </div>
    )}
